import { Component } from "react";
import React from "react";

class App extends Component{
    constructor(){
      super()
      this.state={
          isLogged:true
      }
    }

    render(){
      let wordDisplay
      if(this.state.isLogged)
          wordDisplay="in"
      else
          wordDisplay="out"
      return(
        <div>
            <h1>You're logged  {wordDisplay}</h1>
        </div>
      )
    }
}

export default App
